import axios from "axios";

const BASEURL = "https://api.openweathermap.org/data/2.5/weather?q=Atlanta,US&appid=";
const APIKEY = "b0d00a3f19310077f04a39df76eef0ab";

export default {
  search: function(query) {
    return axios.get(BASEURL + query + APIKEY);
  }
};
